import React from "react";
import Card from "./Card";
import "../Column.css";

export default function Column({ cardData, header }) {
  return (
    <div className="container">
      <h3 className="header">{header}</h3>
      <div className="column">
        {cardData.map((text) => {
          return <Card text={text} />;
        })}
      </div>
    </div>
  );
}
